var tipuesearch = {"pages": [{'title': '簡介', 'text': '組員 \n 40623153\xa0 \n 40423111 \n 40423142 \n 40623138 \n 40623154 \n 40423214 \n 40623134 \n 40623131 \n 40623114 \n 40423159 \n', 'tags': '', 'url': '簡介.html'}, {'title': '課程內容', 'text': '', 'tags': '', 'url': '課程內容.html'}, {'title': '實習任務一', 'text': '可攜式系統 \n \n', 'tags': '', 'url': '實習任務一.html'}, {'title': '自製可攜式系統', 'text': '下載 Python 3.7.2 \n \n 安裝 Python 3.7.2 \n \n \n \n 下載 SciTE \n \n 可比較檔案的工具\xa0KDiff3 \n \n', 'tags': '', 'url': '自製可攜式系統.html'}, {'title': '可攜式程式編輯與認識', 'text': 'Start.bat \n \n stop.bat \n \n', 'tags': '', 'url': '可攜式程式編輯與認識.html'}, {'title': '尋找或編譯分組程式進行分組', 'text': '\n', 'tags': '', 'url': '尋找或編譯分組程式進行分組.html'}, {'title': '可攜式影片', 'text': '40623138的可攜式影片 \n \n 40623153可攜系統影片 \n \n', 'tags': '', 'url': '可攜式影片.html'}, {'title': 'ssh key', 'text': '關閉彈出的登入窗 \n 開啟start.bat後輸入\xa0 git config --edit --system \n 開啟編輯器，編輯git的設定 \n 使用按鍵H/J/K/L控制方向，之後按a進入編輯模式 \n 就可以按Backspace刪除最後一行 \n 如下 \n \n 刪除後按Esc鍵離開編輯模式 \n 輸入2個冒號後，再輸入wq存檔並關閉即可 \n 直接離開則輸入exit即可退出 \n 在可攜系統的程式視窗輸入sh (可至y:\\git\\bin中確認) \n 執行 git 的 shell並輸入(ssh-keygen -t rsa -b 4096 -C "This is my key") \n 將會建立Private 與 Public金鑰至y:\\home\\.ssh\\id_rsa與id_rsa.pub將 id_rsa.pub 的內容複製貼上至Github 帳號的Settings \n 如下 \n \n 在SSH and GPG keys的SSH Key點擊new ssh key並貼上所複製的內容 \n \n 利用ssh提交推送 \n 首先要確認倉儲是以ssh的方式clone \n 利用以下指令clone \n git clone\xa0git@github.com:(mdekmol/github分組網址) \n 或直接使用SciTE編輯器開啟個人倉儲的.git檔案裡面的config檔案 \n 把url = https://github.com/ ( mdekmol/github分組網址) \n 改成url = git@github.com: ( mdekmol/github分組網址) \n 完成後直接提交推送即可不用打帳號密碼就能push。 \n', 'tags': '', 'url': 'ssh key.html'}, {'title': '實習任務二', 'text': 'Onshape及V-rep操作練習 \n', 'tags': '', 'url': '實習任務二.html'}, {'title': 'BubbleRob tutorial', 'text': '操作步驟 : \n 1. \n 依照路徑[Menu bar --> Add --> Primitive shape --> Sphere]新增一個直徑為 : 0.2 m的球體，記得檢查" Create dynamic and respondable shape "是有被勾選的。 \n \n 2. \n 按下ok後，球體便會新增在畫面中，為測試球體是可以調整參數以及可以作動的，<control-space>開始模擬，<control-c>複製球體後再按<control-v>會看到兩球體相撞後各自滾開，驗證此球體是可以作動的。 \n 3. \n 停止模擬，雙擊球體，打開編輯視窗，將 Collidable,   Measurable,   Renderable  and  Detectable  選項勾選 \n \n 4. \n 接著，點選球體，打開位置視窗，切換到 translation ，在Z軸上打上0.02，確定 Relative to 是在 World  後，點擊 Translate selection ，球體就會往上0.02 m \n \n 5. \n [Menu bar --> Add --> Proximity sensor --> Cone type]新增距離感測器，打開方向視窗，切換到Rotation，在Y.Z軸打上90度，按下確定將感測器轉至側邊。 \n \n 6. \n 打開位置視窗，在X及Z軸輸入0.1及0.12將感測器對準球體中心 \n \n 7. \n 雙擊感測器圖示，進到編輯視窗，點擊 Show volume parameter 按鈕，輸入數據如下: \n Offset  : 0.005 \n Angle  : 30\xa0 \n Range  : 0.15 \n 完成後關閉此視窗，點擊 Show detection parameters 按鈕，取消 Don\'t allow detections if distance smaller than 的勾勾。 \n 8. \n 選取球體及感測器[Menu bar --> Edit --> Make last selected object parent] \n 會變成這樣: \n \n 9. \n \xa0[Menu bar --> File --> New scene]新增一個場景之後，新增一個（0.08,0.08,0.02）的圓柱體 \n \n 10. \n 選擇主體檢查一次步驟三的勾選，之後更改主體的 絕對位置 及 絕對方向 ，改完後複製一個副本將絕對位置Y座標設 -0.1 \n \n \n \xa011. \n 將兩個做好的輪子複製，回原本場景貼上。 \n 再來要做接頭 [Menu bar --> Add --> Joint --> Revolute]，保持選擇的接頭再選擇左輪，在位置對話框點擊\xa0 Apply to selection\xa0 ，在方向對話框點擊\xa0 Apply to selection\xa0 ；右輪的設定重複一次設定左輪的方式。設定完的圖示如下，接頭會定位在輪子中心 \n \n 12. \n 在新場景建立一個直徑0.05的球體(滑塊)，一樣讓它具有\xa0 Collidable，Measurable，Renderable和Detectable\xa0 ，[Menu bar --> Add --> Force sensor]添加一個力傳感器並向上移動0.05，將滑塊連接到力傳感器，將兩個物體複製回原場景並沿X軸移動 -0.07連到機器人本體。 \n \n 13. \n 選擇兩個輪子和滑塊，在形狀動態對話框中點擊三次 M = M * 2 \n \n 14. \n [Menu bar --> Tools --> Collections] 打開集合對話框，點 Add new collection\xa0 ，選擇新的集合項目為bubbleRob，點  Add\xa0 ，幫它改名為\xa0 bubbleRob_collection 。 \n \n 15. \n [Menu bar --> Tools --> Calculation module properties]打開計算模塊屬性對話框，點 Add new collection ，選擇新的集合項目 bubbleRob_collection ，重命名為 bubbleRob_distance。 \n', 'tags': '', 'url': 'BubbleRob tutorial.html'}, {'title': '實習任務三', 'text': '\n \n', 'tags': '', 'url': '實習任務三.html'}, {'title': '實習任務四', 'text': '\n \n', 'tags': '', 'url': '實習任務四.html'}, {'title': '實習任務五', 'text': '\n \n', 'tags': '', 'url': '實習任務五.html'}, {'title': '實習任務六', 'text': '\n', 'tags': '', 'url': '實習任務六.html'}, {'title': '個人心得', 'text': '', 'tags': '', 'url': '個人心得.html'}, {'title': '40623153', 'text': '', 'tags': '', 'url': '40623153.html'}, {'title': 'BubbleRob tutorial心得(40623153)', 'text': '看完了 BubbleRob tutorial 文章，對許多單字都還不太認識，需要花時間去查才能把文章看完，也因為上學期有接觸過英文文章，所以越來越有耐心去解讀文章，雖然要花不少時間在認識單字上，但英文真的是蠻重要的語言，透過多讀多看多聽來增強自己的英文能力，對於自己都是有幫助的，多學語言讓自己變得更加充實，文章內的單字在一般也不常見，但對於以後的課程上，多少會用到這些專有名詞，透過這些文章，慢慢的習慣看英文，加上配合v-rep的實際操作，多少能加深一些印象，也對之後的課程有了很好的幫助。 \n', 'tags': '', 'url': 'BubbleRob tutorial心得(40623153).html'}, {'title': '40423111', 'text': '', 'tags': '', 'url': '40423111.html'}, {'title': '40423142', 'text': '', 'tags': '', 'url': '40423142.html'}, {'title': '40623138', 'text': '', 'tags': '', 'url': '40623138.html'}, {'title': 'BubbleRob tutorial心得(40623138)', 'text': '做這個 bubbleRob 真的是挑戰英文，慢慢的查單字去做下一步，過程不會很難，可是要很細心去做每個步驟，了解每個更改地方的意思，剛做完的時候發現 Vision_sensor( 視覺傳感器 ) 沒東西，發現位置沒設好而且內容沒有更改完全，後來就有顯示出來了。還有就是接近傳感器的名字跟程式碼內的名字不一樣，導致一開始模擬的時候 bubbleRob 只會往前衝不會反彈，種種的除錯重試，總算完成了。 \n \n', 'tags': '', 'url': 'BubbleRob tutorial心得(40623138).html'}, {'title': '40623154', 'text': '', 'tags': '', 'url': '40623154.html'}, {'title': 'BubbleRob tutorial心得(40623154)', 'text': '透過turorial學習了很多，不管是英文還是v-rep的熟悉度，跟著文章的步驟慢慢完成，雖然有大半的時間都在解讀英文單子，但可以透過這樣的學習方式來提升英文能力，過程不太難需要得很仔細的去理解教學所講的東西，雖然最後還是沒有完整的做出來，依照教學步驟也找不到問題，但至少比之前熟悉了這個程式，多練習才會進步。 \n \n', 'tags': '', 'url': 'BubbleRob tutorial心得(40623154).html'}, {'title': '40423214', 'text': '', 'tags': '', 'url': '40423214.html'}, {'title': 'BubbleRob tutorial心得(40423214)', 'text': '\xa0\xa0\xa0 上學期已經有做過一個tutorial的機械手臂練習，所以同樣面對這次的全英文教學步驟或多或少都有些習慣，也漸漸的多了些耐心去讀懂這篇教學，多虧了上學期的練習和自己的摸索，做完這次的小汽車碰撞模擬並不是太困難，跟著文章中的步驟一步一步來就能完成，大部分時間還是花在解讀英文上面，雖然說過程不是太困難，但還是有遇到一些問題 : 按部就班地跟著教學步驟走，該設定的都設定了，該給的程式碼也輸入進去了，但小汽車就是不會避開眼前的障礙物，義無反顧地往前衝，以為是哪個步驟做錯了，重新檢查了一遍，確定步驟都沒錯，才突然發現我每個部件的名稱與程式碼裡的名稱並不完全一樣，更改成一致後就沒問題了，以下為完成影片 : \n \n \n \n', 'tags': '', 'url': 'BubbleRob tutorial心得(40423214).html'}, {'title': '40623134', 'text': '', 'tags': '', 'url': '40623134.html'}, {'title': 'BubbleRob tutorial心得(40623134)', 'text': '對於英文方面的熟悉度，雖然不至於到完全看不懂，但是一篇文章看得東缺西漏的很痛苦，所以藉由這次能熟悉相關的英文單字，能在往後對專題設計能有更大的突破口，更不會在語言方面遇到瓶頸，目前跟著教學文章一字一句的慢慢前進，剛開始心情確實是五味雜陳，因為不懂而帶來的困惑與不耐煩，到完成後透露出的喜悅與興奮感，非常耐人尋味，但那些都只是一部分，重點在於我能(想)走多遠。', 'tags': '', 'url': 'BubbleRob tutorial心得(40623134).html'}, {'title': '40623131', 'text': '', 'tags': '', 'url': '40623131.html'}, {'title': '40423159', 'text': '個人網站: https://40423159.github.io/2019cd/content/index.html', 'tags': '', 'url': '40423159.html'}, {'title': 'BubbleRob tutorial心得(40423159)', 'text': '這週把BubbleRob tutorial任務製作出來了，也順利讓它跑成功了，雖然過程中遇到不少問題，也利用別人的教學影片看了一次，才慢慢順利做出來，雖然軟體的應用上還不夠成熟，但我希望自己能夠越來越熟練，能將v-rep做得更好，也希望加深自己英文能力，才能夠將文章的內容全看懂。 \n BubbleRob tutorial成功影片： https://www.youtube.com/watch?v=J0zS_jfyA7M&t= \n \n', 'tags': '', 'url': 'BubbleRob tutorial心得(40423159).html'}, {'title': '40623114', 'text': '', 'tags': '', 'url': '40623114.html'}, {'title': 'ungit', 'text': '配置 ungit \n 1. 進入  http://mde.tw/wcm2019/content/實習項目二.html\xa0  ，下載 \xa0 kmol_2019.7z \xa0和  \xa0 nodejs_with_ungit.7z \xa0。 \n \n 2. 兩者分別解開壓縮檔案，然後將 nodejs 放入可攜 data 目錄中。 \n \n 3. 設定命令列搜尋路徑 \n 利用SciTE 編輯器編輯 start_cadlab.bat(及start.bat)。 \n 路徑指令: set path8=%Disk%:\\nodejs;%Disk%:\\nodejs\\appdata\\roaming\\npm; \n \n 並且將 path8 納入 path 設定 \n \n 4. 設定 USERPROFILE 環境變數 \n \n 5. 若要啟動 ungit，必須使用下列指令: \n ungit --launchBrowser=0 --launchCommand "C:\\PROGRA~2\\Google\\Chrome\\Application\\chrome.exe %%U" \n \n', 'tags': '', 'url': 'ungit.html'}, {'title': 'ungit使用方式', 'text': '\xa0git add . 後使用 ungit \n \n 輸入這次提交的主題後按下commit \n \n 在按一次commit後的分支點擊push \n \n 再輸入使用者帳號密碼後推送完成 \n !!輸入完成後要直接按"Submit"扭，使用鍵盤的"Enter"無法完成!! \n \n', 'tags': '', 'url': 'ungit使用方式.html'}, {'title': 'ungit問題與解決方式', 'text': '問題:無法指定user以及email \n \n 解決方式:在home資料夾下新增 \n .gitconfig \n ------------------- \n [name] \n xxxxxxx \n xxxxxxx@gm.nfu.edu.tw \n -------------------', 'tags': '', 'url': 'ungit問題與解決方式.html'}]};